INSERT INTO `producto` VALUES (20,1,6,'Botas de Moto Sidi MAG-1 Air Rojo Fluo-Negro','qqqqqqqqqqqqqqqqqqqqqqqqqqqqqqqqqqqq\r\nqqqqqqqqqqqqqqqqqqqqqqqqqqqqqqqqqqq\r\nqqqqqqqqqqqqqqqqqqqqqqqqqqqqqqqqqqqq\r\nqqqqqqqqqqqqqqqqqqqqqqqqqqqqqqqqqq\r\nqqqqqqqqqqqqqqqqqqqqqq',33,333),(23,1,6,'botas 2','ewwwwwwwwwwwwwwfffffffffffffffffffsssss\r\nsdaadfdfffffffffffffffffffffffffffffffffffffffffffff\r\nqerfrfffrrrrrrrrrrrrrrrrrrrrrrrrrrrrrrrrrrrrrrrrrrrrrrrrr',50.5,35),(24,1,1,'GUANTES SPORT BSTAR PIEL TT','Guantes moto fabricado en piel de vaca Negro (Analine Flexible) y cuero perforado\r\n\r\n		Proteccion en carbono en los nudillos de goma en los dedos, y Pittard parche de cuero en la palma,\r\n\r\n		Ajuste de velcro en la muñeca\r\n\r\n		Forro interior fino para una mejor agarre.\r\n		ideal uso racing',36.5,20),(25,3,1,'GUANTES VERANO STINA MBG4236','Guantes moto fabricado en CORDURA Negro (Analine Flexible) perforado,\r\n		Proteccion en nudillos Protección de goma en los dedos, y Pittard parche de cuero en la palma,\r\n		Ajuste de velcro en la muñeca\r\n		Forro interior para una mejor agarre.\r\n		ideal uso racing verano.\r\n\r\n		NOTA . se sirve el guante con protecccion en todos los nudillos\r\n\r\n		Promoción ENVIO GRATIS peninsula, entrega opción 24/48 horas',95,10),(26,2,1,'GUANTES VERANO RAINERS SPRINT','Guantes racing Rainers Sprint en color negro.\r\n\r\n		Fabricados con refuerzo en nudillos y piel antideslizante en la palma de la mano\r\n\r\n		Banda elástica de neopreno.\r\n\r\n		Piel Protector de nudillos y TPU Bandas elásticas de neopreno\r\n\r\n		Refuerzo de piel antideslizante en la palma de la mano\r\n\r\n		Cierre mediante velcro Forro poliéster\r\n\r\n		Composicion\r\n		Exterior\r\n		75 % piel\r\n		10% poliuertano\r\n		10% poliester\r\n		5% goma\r\n		Interior\r\n		100 % forro poliester',62.3,76),(27,2,2,'CASCO SUPERSÓNICO','eqwwweeeeeeeeeeeeeeeeeeeee\r\n\r\neeeeeeeeeeeeeeeef\r\nfffewfwwewfwefewfewfewfewfewfewf\r\nfwfwefewfewfewfewfewewfewfewfewf',45,15),(28,1,2,'CASCO SCHUBERTH S2 SPORT MATT BLACK','El casco más versátil de Schuberth. Con visor solar integrado, es capaz de adaptarse a las \r\nexigencias de todo tipo de pilotos (sport y touring). Dispone de un innovador sistema de ventilación, \r\ncon una impresionante salida de aire en la parte trasera, que garantiza que la cabeza del piloto esté siempre a una temperatura agradable. \r\nEn términos de aerodinámica y aero-acústica, cuenta con características técnicas avanzadas de alto nivel. \r\nPor lo que se refiere al confort, destacan el diseño optimizado del acolchado del cuello (que permite que el casco se coloque más \r\nfácilmente) y los acolchados adicionales en las orejas.',222,23),(29,1,2,'CASCO ALPINESTARS SUPERTECH S-M10','Alpinestars presenta su primer casco Off-Road y dota al Supertech S-M10 de los últimos avances tecnológicos.\r\n Se caracteriza por ser muy ligero y destaca por incorporar el sistema de protección MIPS E-2 y la innovadora tecnología A-Head, \r\nque permite un ajuste interior muy personalizado. La visera ha sido diseñada para que se desprenda en caso de una eventual caíd',56.23,23),(30,2,3,'CHAQUETA DAINESE NEXUS BLACK','Chaqueta de piel Dainese Nexus Negra .Chaqueta deportiva confeccionada en piel bovina. Incorpora protecciones certificadas en hombros y codos y dispone, además, de dos prácticas entradas de aire. Cuenta con paneles de tejido bielástico estratégicamente ubicados para proporcionar máximo confort y flexibilidad.',34,34),(31,1,3,'CHAQUETA ALPINESTARS GP','Chaqueta de piel Alpinestars GP Plus R V3 . Chaqueta deportiva confeccionada en piel de primera calidad; destaca por su confort, protección y diseño. Incorpora inserciones elásticas estratégicamente ubicadas, protecciones Nucleon Flex Plus  en hombros y codos, refuerzos externos en los hombros y dos prácticas entradas de aire laterales.',222,34),(32,2,3,'CHAQUETA DAINESE ANTARTICA','Chaqueta Dainese Antartica Gore-Tex . Ideal para la conducción en las zonas más frías del planeta, esta chaqueta se adapta a la perfección a cualquier condición climática. Cuenta con forro de plumón extraíble para un rendimiento térmico excepcional (éste puede usarse por separado), membrana laminada Gore-Tex® (45.000 mm) para una protección inigualable en caso de lluvia y ventilaciones con cremallera para los días más cálidos. Dispone además de innovadoras características como unos bolsillos para guardar rápidamente los guantes y una faja lumbar para un perfecto ajuste al cuerpo. Esta chaqueta está confeccionada en nylon 6.6 con refuerzos de tejido Trixior D-Tec en puntos clave de impacto e incorpora protectores homologados en hombros, codos y espalda, garantizando así una excelente resistencia y protección.',349,55);
